import React, { Component, useState } from "react";
import axios from "axios";

class Temp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      lat: 49.203,
      lon: -122.9914,
    };
  }
  getGeoInfo = () => {
    axios
      .get(
        "api.openweathermap.org/data/2.5/weather?lat={" +
          { lat } +
          "}&lon={" +
          { lon } +
          "}&appid=8f61a1e09924a4c204d0927cfe0ff964"
      )
      .then((response) => {
        let data = response.data;
        this.setState({
          temp: data.main.temp,
          wind: data.wind.speed,
        });
      })
      .catch((error) => {
        console.log(error);
      });
  };
  componentDidMount() {
    this.getGeoInfo();
  }
  render() {
    return (
      <div>
        <p>Temp: {this.state.temp}</p>
        <p>Wind: {this.state.wind}</p>
      </div>
    );
  }
}

export default Temp;
